/*
You are given an array of events where events[i] = [startDayi, endDayi, valuei]. The ith event starts at startDayi and ends at endDayi, and if you attend this event, you will receive a value of valuei. You are also given an integer k which represents the maximum number of events you can attend.

You can only attend one event at a time. If you choose to attend an event, you must attend the entire event. Note that the end day is inclusive: that is, you cannot attend two events where one of them starts and the other ends on the same day.

Return the maximum sum of values that you can receive by attending events.

 

Example 1:



Input: events = [[1,2,4],[3,4,3],[2,3,1]], k = 2
Output: 7
Explanation: Choose the green events, 0 and 1 (0-indexed) for a total value of 4 + 3 = 7.
Example 2:



Input: events = [[1,2,4],[3,4,3],[2,3,10]], k = 2
Output: 10
Explanation: Choose event 2 for a total value of 10.
Notice that you cannot attend any other event as they overlap, and that you do not have to attend k events.
Example 3:



Input: events = [[1,1,1],[2,2,2],[3,3,3],[4,4,4]], k = 3
Output: 9
Explanation: Although the events do not overlap, you can only attend 3 events. Pick the highest valued three.
 

Constraints:

1 <= k <= events.length
1 <= k * events.length <= 106
1 <= startDayi <= endDayi <= 109
1 <= valuei <= 106


POST: https://leetcode.com/problems/maximum-number-of-events-that-can-be-attended-ii/discuss/1084264/javascript-bottom-up-dp-200ms
*/


var maxValue = function (events, k) {
  events.sort((a, b) => a[1] - b[1] || a[0] - b[0]);
  const prevEvents = events.map((_, i) => findPreviousEvent(events, i));

  let currentMaxSum = [events[0][2]];

  for (let event = 1; event < events.length; event += 1) {
    currentMaxSum.push(
      Math.max(events[event][2], currentMaxSum[event - 1]),
    );
  }

  let nextMaxSum = currentMaxSum.slice();
  let maxPossible = currentMaxSum[currentMaxSum.length - 1];

  for (let numEvents = 1; numEvents < k; numEvents += 1) {
    nextMaxSum[numEvents - 1] = 0;
    for (let event = numEvents; event < events.length; event += 1) {
      if (prevEvents[event] < 0) {
        nextMaxSum[event] = nextMaxSum[event - 1]
        continue;
      }
      nextMaxSum[event] = Math.max(
        nextMaxSum[event - 1],
        currentMaxSum[prevEvents[event]] + events[event][2]
      );
    }
    maxPossible = Math.max(maxPossible, nextMaxSum[events.length - 1]);
    [currentMaxSum, nextMaxSum] = [nextMaxSum, currentMaxSum];
  }

  return maxPossible;
};

const findPreviousEvent = (events, target) => {
  const start = events[target][0];
  if (events[0][1] >= start) return -1;

  let left = 0;
  let right = target - 1;
  let mid;

  while (left < right) {
    mid = Math.ceil((left + right) / 2);

    if (events[mid][1] >= start) {
      right = mid - 1;
    } else {
      left = mid;
    }
  }

  return left;
}

